import React from "react";
import { View } from "react-native";

function Paginator({ data }) {
  console.log("Paginator data: ", data);
  return (
    <View style={{ flex: 0.2, flexDirection: "row", height: 64 }}>
      {data.map((_, i) => {
        return (
          <View
            key={i.toString()}
            style={{
              width: 10,
              height: 10,
              borderRadius: 5,
              backgroundColor: "#493d8a",
              marginHorizontal: 8,
            }}
          />
        );
      })}
    </View>
  );
}

export default Paginator;
